package utils;

import java.text.DecimalFormat;
import java.util.ArrayDeque;
import java.util.HashMap;
import java.util.Map;
import java.util.Queue;

public class Recorder {

	private static final int QSIZE = 20;
	public static Map<String, Queue<Long>> times = new HashMap<>();
	private static DecimalFormat df = new DecimalFormat("0.000");
	
	public static void record(StopWatch chrono) {
		Queue<Long> q = times.get(chrono.name);
		if (q==null) {
			q = new ArrayDeque<Long>();
			times.put(chrono.name, q);
		} 
		q.add(chrono.time());
		if (q.size()>QSIZE)
			q.poll();
	}

	public static String str() {
		String res = new String();
		for (String item : times.keySet()) {
			double sum=0;
			int count=0;
			for (Long l : times.get(item)) {
				sum+=l;
				count++;
			}
			res+=item+":"+df.format(sum/count/1_000_000)+"ms    ";
		}
		return res;
	}
}


	
	
	